import React from "react";
import bgImage from "../assets/images/photo10@2x.jpg";

const Overview = () => {
  return (
    <div style={{ height: "300px", overflow: "hidden" }}>
      <div className="bg-image" style={{ backgroundImage: `url(${bgImage})` }}>
        <div className="hero bg-primary-dark-op">
          <div className="hero-inner">
            <div className="container h-100">
              <div className="row h-100 align-items-center">
                <div className="col-md-6 text-white">
                  <h1 className="display-4 font-w700 mb-3">File converter</h1>
                  <p className="lead">
                    CloudConvert is an online file converter. We support nearly
                    all audio, video, document, ebook, archive, image,
                    spreadsheet, and presentation formats. To get started, use
                    the button below and select files to convert from your
                    computer.
                  </p>
                  <a href="#" className="btn btn-light mt-3">
                    Get Started
                  </a>
                </div>
                <div className="col-md-6">
                  {/* Space for right-side image */}
                  <div
                    style={{
                      height: "100%",
                      background: "rgba(255,255,255,0.1)",
                    }}
                  >
                    {/* You can place your image here */}
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Overview;
